import React from "react";

const ErrorIcon = ({children}) => {
  return(
      <div>
      <i class="target-icon"/>
      {children}
      </div>
  )
}

const ErrorBox = () => {
  return(
    <div>
      <ErrorIcon>Something is wrong!</ErrorIcon>
    </div>
  )
}

export default ErrorBox;
